import React, { Component } from 'react';
import './css/main.css'

// import fire from './fire';

class NavigationBarLink extends Component {
    constructor(props) {
        super(props);
        this.state = {
        };
        // this.funct = this.funct.bind(this);
        // this.submitPost = this.submitPost.bind(this)
    }

    render() {
        var InnerText = this.props.InnerText
        var link = this.props.link
        var imgSource = this.props.imgSource
        return (
           <li class="nav-link"><a href= {link} > {InnerText}</a> {imgSource == null? <img src = {imgSource} ></img>: null }</li>
        );
    }


}
export default NavigationBarLink;
